/* eslint-disable react/no-array-index-key */
/* eslint-disable react/button-has-type */
/* eslint-disable react/self-closing-comp */
import React, { useState } from 'react';

const Dashboard = () => {
    const [ids, setIds] = useState(['axo123nihzscd', '3-1a-scjk90zu', '391=z-ckxz9uasd']);
/*
Coordinate 0:51.509740386518544,-0.11059858633703445
polygon.js:16 Coordinate 1:51.49876714002704,-0.15696897723043562
polygon.js:16 Coordinate 2:51.476252387450984,-0.14120069968085197
polygon.js:16 Coordinate 3:51.46816585662399,-0.09069366646197412
polygon.js:16 Coordinate 4:51.50325538781217,-0.08685193396647416
polygon.js:16 Coordinate 5:51.509740386518544,-0.11059858633703445
*/
    return (
      <div className="dashboard">
        <div className="dashboard-header">
          <h4>Vehicles in selected area:</h4>
          <button>Show cars in area</button>
        </div>
        <div className="ids-list">
          {ids.map((id, index) => <p key={index}>{id}</p>)}
        </div>
      </div>
    );
};

export default Dashboard;
